    true,nt"url": null,nt"notes": "The National Assessment of Educational Progress,
    2012 Long-Term Trend (NAEP 2012 LTT), is a study that is part of the National Assessment
    of Educational Progress (NAEP) program; program data is available since 1971 at
    http://nces.ed.gov/nationsreportcard/naepdata/. NAEP 2012 LTT (http://nces.ed.gov/nationsreportcard/ltt)
    is a cross-sectional survey that assesses what America's students know and can do
    in reading and mathematics. NAEP 2012 Long-Term Trend assessment was administered
    to students aged 9, 13, and 17 who were enrolled in public and non-public elementary
    and secondary schools throughout the nation.",nt"license_title": "Creative
